// src/App.js
import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import IntroPage from './pages/IntroPage';
import Algorithm1 from './pages/algorithms/algorithm-1';
import Algorithm2 from './pages/algorithms/algorithm-2';
import Algorithm3 from './pages/algorithms/algorithm-3';

const App = () => {
  return (
    <BrowserRouter>
      <Navbar />
      <Routes>
        <Route path="/" element={<IntroPage />} />
        <Route path="/algo/1" element={<Algorithm1 />} />
        <Route path="/algo/2" element={<Algorithm2 />} />
        <Route path="/algo/3" element={<Algorithm3 />} />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
